import React from 'react';
import './Contact.css'; // Asegúrate de que la ruta al archivo CSS sea correcta

const Contact = () => {
  return (
    <div className="contact-container">
      <h2>¡COMUNÍCATE CON NOSOTROS!</h2>
      <p>O aún mejor, ¡Ven a visitarnos!</p>
      <p>Para más información puede enviarnos un correo a:</p>
      <p><a href="mailto:cientifico.alajuela@mep.go.cr">cientifico.alajuela@mep.go.cr</a></p>

      <h3>COLEGIO CIENTÍFICO DE ALAJUELA</h3>
      <p>Avenida Central, Calle 18-20, Frente a Plaza Ferias</p>
      <p>Alajuela, Costa Rica</p>
      <p>Tel. (506) 2430-9782  (506) 2431-4405</p>

      {/* Mapa de Google */}
      <div className="google-map">
        <iframe
          src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3930.356444360131!2d-84.21079608562113!3d10.014437992839152!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8fa0fa6b5102f39d%3A0x408af488b0c5f30!2sAlajuela%20Province%2C%20Alajuela!5e0!3m2!1sen!2scr!4v1633063420346!5m2!1sen!2scr"
          width="600"
          height="450"
          style={{ border: 0 }}
          allowFullScreen=""
          loading="lazy"
        ></iframe>
      </div>
    </div>
  );
}

export default Contact;
